import React from "react";

import "./App.css";
import NavBar from "./Component/NavBar";
import Product from "./Component/Product";
import Content from "./Component/Content";
import ProductsList from "./Component/ProductsList";

function App() {

  let data = [
    {
      trackName: "React",
      bgColor: "bg-light",
      instName: "Abdelfattah Elnaggar",
    },
  ]
  return (
    <div className="App">
      <NavBar />
      <ProductsList></ProductsList>
      <Content objectData={data[0]}>
        <button className="btn btn-outline-danger fw-bolder">Show More!</button>      
      </Content>
    </div>
  );
}

export default App;
